window.bookSummaryJSON = "<p><b>Dying planets, dangerous conspiracies, and secret romance abound in the second installment of the Devoured Worlds trilogy by award-winning author Megan E. O'Keefe.</b> </p> <p>Naira and Tarquin have escaped vicious counter-revolutionaries, misprinted monsters, and the pull of a dying planet. Now, bound together to find the truth behind the blight that has been killing habitable planets, they need to hunt out the Mercator family secrets. But, when the head of Mercator disappears, taking the universe’s remaining supply of starship fuel with him, chaos breaks loose between the ruling families. Naira’s revolution must be put aside for the sake of humanity’s immediate survival.</p> <p><b>The Devoured Worlds</b><br> <i>The Blighted Stars<br> The Fractured Dark</i></p>"; 
